    var hash = new SHA512();
    hash.add(createTestArr(i));
    var d = hash.close();
    Expect.equals(expected_values[i], CryptoUtils.bytesToHex(d), '$i');
  }
}

void testInvalidUse() {
  var sha = new SHA512();
  sha.close();
  Expect.throws(() => sha.add([0]), (e) => e is HashException);
}

void testRepeatedDigest() {
  var sha = new SHA512();
  var digest = sha.close();
  Expect.listEquals(digest, sha.close());
}

void testStandardVectors(inputs, mds) {
  for (var i = 0; i < inputs.length; i++) {
    var hash = new SHA512();
    hash.add(inputs[i]);
    var d = hash.close();
    Expect.equals(mds[i], CryptoUtils.bytesToHex(d), '$i');
  }
}

void main() {
  test();
  testInvalidUse();
  testRepeatedDigest();
  testStandardVectors(sha512_long_inputs, sha512_long_mds);
  testStandardVectors(sha512_short_inputs, sha512_short_mds);
}

